import LocationTrade from './components/LocationTrade/LocationTrade';
import LocationProduct from './components/LocationProduct/LocationProduct';

import './App.css';

import Logo from './assets/images/logoROJOPNG.png'
// import Iacerca from './assets/images/Iacerca.png';
// import Ipromo from './assets/images/Ipromo.png';
function App() {
  return (
   <>
   <div class="ui equal width form" >
   <div class="fields">
   <div class="field">
    </div>
    <div class="field">
    </div>
            <div class="field">
            <img src={Logo} />
            </div>
            <div class="field">
    </div>
        </div>
    </div>


   <div class="ui equal width form" id="demo-form">
        <div class="fields">
            <LocationTitle></LocationTitle>
        </div>
        <div class="fields">
            <LocationCity></LocationCity>
        </div>
        <div class="fields">
            <LocationZone></LocationZone>
        </div>
        <div class="fields">
            <LocationNeighborhood></LocationNeighborhood>
        </div>

        <div class="fields">
            <LocationTrade></LocationTrade>
        </div>

        <div class="fields">
            <LocationProduct></LocationProduct>
        </div>
    </div>
    </>
    );
}

export default App;
